import ExpenseItem from './ExpenseItem'

function Expenses(probs) {
  return (
    <div>
      <ExpenseItem
        title={props[0].title}
        amount={probs[0].amount}
        date={probs[0].date}
      />
      <ExpenseItem
        title={probs[1].title}
        amount={probs[1].amount}
        date={probs[1].date}
      />
      <ExpenseItem
        title={probs[2].title}
        amount={probs[2].amount}
        date={probs[2].date}
      />
    </div>
  );
}

export default Expenses;
